description:
Verenigde Staten
Actie / Thriller
86 minuten

goed

met Clive Owen, Monica Bellucci en Paul Giamatti

Mr. Smith (Clive Owen), helpt bij een bevalling. Hij belandt ter plekke in een vuurgevecht, waarbij de moeder wordt gedood. De 
daders, die banden lijken te hebben met enkele politici, bleken het echter op de baby voorzien te hebben, en aan Mr. Smith de 
taak om deze vervolgens te beschermen, met behulp van een prostituee die hij ontmoet.
